import React from 'react';
import MovieCard from '../components/MovieCard';

import '../styles/Search.css'

const SearchPage = (movies) => {
  <div>
    {movies.map((movie, i) => (
      <MovieCard key={i} posterPath={movie?.poster_path} />
    ))}
  </div>
}

export default SearchPage
